function bitwise(a, b) {
    alert("a AND b: " + (a & b));
    alert("a OR b: " + (a | b));
    alert("a XOR b: " + (a ^ b));
    alert("NOT a: " + ~a);
    alert("a << b: " + (a << b)); // left shift
    alert("a >> b: " + (a >> b)); // arithmetic right shift
    alert("a >>> b: " + (a >>> b)); // logical right shift
}
